import BrandFilter from './BrandFilter';
import Location from './Location';



const NavBar2 = ({ data, selected }) => {
    return (
        <div>
            <BrandFilter
                data={data}
                selected={selected}
            />
            <Location />

        </div>
    )
}

export default NavBar2;
